css:
.output-panel {
  font-size: 12px;
}
.output-panel .resizer {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 4px;
  cursor: row-resize;
  z-index: 10;
}
.output-panel .panel-heading {
  position: relative;
  cursor: default;
}
.output-panel .panel-heading .action-close {
  border: 0 none;
  background: transparent;
  position: absolute;
  top: 0;
  right: 0;
  height: 100%;
  cursor: pointer;
}
.output-panel .panel-heading .action-close::before {
  width: 28px;
  margin-right: 0;
  text-align: center;
  vertical-align: middle;
}
.output-panel .panel-heading .action-close::after {
  content: '';
  display: inline-block;
  height: 100%;
  vertical-align: middle;
}
.output-panel .panel-body {
  height: 100%;
  padding: 4px;
  background: rgba(0, 0, 0, 0.3);
}
.output-panel .terminal {
  background: transparent;
  line-height: normal;
}
.output-panel .terminal .xterm-viewport {
  background: transparent;
}
.output-panel .terminal .xterm-viewport::-webkit-scrollbar-thumb {
  border-color: transparent;
}
.output-panel .terminal .xterm-viewport::-webkit-scrollbar-track {
  background: transparent;
}
